function HomePage() {
  return (
    <div>
      <div> 
        <h2>Hyper Cars</h2>
      </div>
      <div>
        <h2>Sport Cars</h2>
      </div>
      <div>
        <h2>Mommy's Cars</h2>
      </div>
    </div>
  );
}

export default HomePage;
